package com.opencn.mesh;import com.opencn.mesh.model.PipelineRequest;import com.opencn.mesh.model.PipelineResponse;import com.opencn.mesh.service.BizCommonService;public class DefaultBizCommonService implements BizCommonService {    @Override    public PipelineResponse invoke(String bizKey, PipelineRequest request) {        return  BizMappingRegister.execute(bizKey, request.getBizData());    }    @Override    public PipelineResponse callback(String bizKey, Object request) {        return  BizMappingRegister.execute(bizKey, request);    }}